import React from 'react'
import Button from './Button'
const Form = ({reqType, setReqType}) => {
  return (
    <form onSubmit={(e) => e.preventDefault()}>
       <Button
          buttonText = "users"
          reqType = {reqType}
          setReqType = {setReqType}
       />
         <Button
          buttonText = "posts"
          reqType = {reqType}
          setReqType = {setReqType}
       />
         <Button
          buttonText = "commments"
          reqType = {reqType}
          setReqType = {setReqType}
       />
    </form>
  )
}

export default Form
